package concat;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int mark=112;
		
		switch(mark) {
		
		case 10:
			System.out.println("pass");
			break;
			default:
			System.out.println("invalid");
		}

		int i=1;
		do {
			
			System.out.println("print");
		}
		while(i>1);
	}

}
